package org.github.xubo245.carbonDataLearning.image;

import org.apache.commons.codec.DecoderException;
import org.apache.commons.codec.binary.Hex;

import java.io.*;

public class TestImage {
  public static void main(String[] args) throws IOException, DecoderException {

    save("/Users/xubo/Desktop/xubo/git/carbondata3/store/sdk/target/hex.jpg");
//    moveFile("/Users/xubo/Desktop/xubo/git/carbondata3/store/sdk/src/main/resources/images/multi-channel/BGRA.png"
//        , "/Users/xubo/Desktop/xubo/git/carbondata3/store/sdk/target/BGRA.png.txt");

    write("/Users/xubo/Desktop/xubo/git/CarbonDataLearning/data/images/multi-channel/BGRA.png"
        , "/Users/xubo/Desktop/xubo/git/CarbonDataLearning/target/BGRA.txt");

    readAndSave("/Users/xubo/Desktop/xubo/git/CarbonDataLearning/target/BGRA.txt", "/Users/xubo/Desktop/xubo/git/CarbonDataLearning/target/BGRA.png");
//    moveFile("","");
  }

  private static void moveFile(String srcString, String destString) throws IOException {
    long start = System.nanoTime();
    BufferedInputStream bis = new BufferedInputStream(new FileInputStream(srcString));
    BufferedOutputStream bos = new BufferedOutputStream(new FileOutputStream(destString));

    byte[] by = new byte[1024];
    int len = 0;
    while ((len = bis.read(by)) != -1) {
      System.out.println(by);
      bos.write(by);
    }

    bos.close();
    bis.close();
    long end = System.nanoTime();
    System.out.println("time is: " + (end - start) / 1000000.0 + " ms");
  }

  private static void write(String srcString, String destString) throws IOException {
    long start = System.nanoTime();
    BufferedInputStream bis = new BufferedInputStream(new FileInputStream(srcString));

    File f = new File(destString);
    FileWriter fw = new FileWriter(f.getAbsoluteFile(), true);  //true表示可以追加新内容
    //fw=new FileWriter(f.getAbsoluteFile()); //表示不追加
    BufferedWriter bw = new BufferedWriter(fw);

    byte[] by = new byte[1024];
    int len = 0;
    while ((len = bis.read(by)) != -1) {
      System.out.println(by);
      char[] value = Hex.encodeHex(by);
      System.out.println(Hex.encodeHex(by));
      bw.write(value);
    }

    bw.close();
    bis.close();
    long end = System.nanoTime();
    System.out.println("time is: " + (end - start) / 1000000.0 + " ms");
  }

  private static void readAndSave(String srcString, String destString) throws IOException {
    File f = new File(srcString);
    FileReader fw = new FileReader(f.getAbsoluteFile());  //true表示可以追加新内容
    //fw=new FileWriter(f.getAbsoluteFile()); //表示不追加
    BufferedReader bw = new BufferedReader(fw);

    try {
      BufferedOutputStream bos = new BufferedOutputStream(new FileOutputStream(destString));
      String value = bw.readLine();
      byte[] decodeValue = Hex.decodeHex(value.toCharArray());
      System.out.println(value);
      bos.write(decodeValue);
      bos.close();
    } catch (Exception e) {
      e.printStackTrace();
    } finally {
    }
  }

  private static void save(String destString) {
    try {
      BufferedOutputStream bos = new BufferedOutputStream(new FileOutputStream(destString));
      byte[] value;
      value = Hex.decodeHex("".toCharArray());
      System.out.println(value);
      bos.write(value);
      bos.close();
    } catch (Exception e) {
      e.printStackTrace();
    } finally {
    }
  }
}
